import Header from './Header'
import Footer from './Footer'

function App() {
  return (
    <div className="App">
      <Header />
      <div className="content">
        <p>Content goes here</p>
        <button>Compare</button>
      </div>
      <Footer />
    </div>
  );
}

export default App;
